import "./index.css";
const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>The Dojo blog</h1>
      <div className="links">
        <a href="/">Home </a>
        <a
          href="/create"
          style={{
            color: "white",
            backgroundColor: "#f1356d",
            borderRadius:"8px"
          }}
        >
          create
        </a>
      </div>
    </nav>
  );
};

export default Navbar;
